import React from "react";
import { FooterMain } from "./FooterStyleds";

const Footer = () => {
  return (
    <FooterMain>
      <h3>
        Feito com amor{" "}
        <span role="img" aria-labelledby="heart">
          ❤️
        </span>
        para a equipe IPE
      </h3>
      <h3>Nossa Equipe</h3>
    </FooterMain>
  );
};

export default Footer;
